import Files from "./Files";

const Layout = props => (
  <div className="layout">
    {props.children}
    <Files />
    <style jsx>{`
      .guc {
        height: 93%;
        width: 93%;
      }
      .layout {
        margin: 20,
        padding: 20
      }
    `}</style>
  </div>
);

export default Layout;
